import "./Staff.css"

export const AddStaff = () => {

    return (
        <>
            <h2 className="addStaffHeader">Add New Staff Member</h2>
            <form>
                <fieldset >
                    <div className="form-group">
                        <label className="label" htmlFor="bandName">Band Name: </label>
                        <input
                            required autoFocus
                            type="text"
                            className="form-control"
                            value={request.bandName}
                            onChange={
                                (event) => {
                                    const copy = { ...request }
                                    copy.bandName = event.target.value
                                    setBookingForm(copy)
                                }
                            }
                        />
                    </div>
                </fieldset>
            </form>
        </>
    )
}
